import React from "react";
import styled from "styled-components";
import AliceCarousel from "react-alice-carousel";
import "react-alice-carousel/lib/alice-carousel.css";
import Product1 from "../../assets/images/2020-69.png";
import { HiChevronLeft } from "react-icons/hi";

const style = {
  "max-height": "90%",
  "max-width": "90%",
  "object-fit": "contain",

};

const handleDragStart = (e) => e.preventDefault(); 
const items = [
  <img src={Product1} alt="product1" style={style} />,
  <img src="../../assets/images/2020-70.png" alt="product2" />,
  <img src="../../assets/images/2020-71.png" alt="produtc3" />,
  <img src="../../assets/images/2020-72.png" alt="produtc4" />,
  <img src="../../assets/images/2020-73.png" alt="produtc5" />,
  <img src="../../assets/images/2020-74.png" alt="produtc6" />,
  <img src="../../assets/images/2020-75.png" alt="produtc7" />,
  <img src="../../assets/images/2020-76.png" alt="graphic1" />,
  <img src="../../assets/images/2020-77.png" alt="graphic2" />,
  <img src="../../assets/images/2020-78.png" alt="graphic3" />,
  <img src="../../assets/images/2020-79.png" alt="graphic4" />,
  <img src="../../assets/images/2020-80.png" alt="graphic5" />,
  <img src="../../assets/images/2020-81.png" alt="graphic6" />,
  <img src="../../assets/images/2020-69.png" alt="graphic7" />,
  <img src="../../assets/images/2020-82.png" alt="graphic8" />,
  <img src="../../assets/images/2020-83.png" alt="graphic9" />,
  <img src="../../assets/images/2020-84.png" alt="graphic10" />,
  <img src="../../assets/images/2020-85.png" alt="graphic11" />,
  <img src="../../assets/images/2020-86.png" alt="graphic12" />,
  <img src="../../assets/images/2020-87.png" alt="graphic13" />,
  <img src="../../assets/images/2020-88.png" alt="graphic14" />,
  <img src="../../assets/images/2020-89.png" alt="graphic15" />,
  <img src="../../assets/images/2020-90.png" alt="graphic16" />,
  <img src="../../assets/images/2020-91.png" alt="graphic17" />,
  <img src="../../assets/images/2020-92.png" alt="graphic18" />,
  <img src="../../assets/images/2020-93.png" alt="graphic19" />,
  <img src="../../assets/images/2020-94.png" alt="graphic20" />,
  <img src="../../assets/images/2020-95.png" alt="graphic21" />,
  <img src="../../assets/images/2020-96.png" alt="graphic22" />,
  <img src="../../assets/images/2020-97.png" alt="graphic23" />,
];
const productItems = items.slice(0, 7);
const graphicItems = items.slice(7);

renderPrevButton: () => <HiChevronLeft />

const renderNextButton = ({ isDisabled }) => {
    return <span style={{ opacity: isDisabled ? '0.5' : 1 }}>&gt;</span>;
};

export const ProductCarousel = () => {
  return (
    <AliceCarousel
    autoPlay
      autoPlayStrategy="default"
      autoPlayInterval={1500}
      animationDuration={1500}
      animationType="slide"
      infinite={true}
    disableDotsControls
        disableButtonsControls
        mouseTracking
        renderPrevButton={renderPrevButton}
        renderNextButton={renderNextButton}
      items={productItems}
    />
  );
};
export const GraphicCarousel = () => {
  return (
    <AliceCarousel
      autoPlay
      autoPlayStrategy="default"
      autoPlayInterval={1500}
      animationDuration={1500}
      animationType="slide"
      infinite={true}
      items={graphicItems}
    />
  );
};
export const FullCarousel = () => (
  <AliceCarousel
    items={items}
  />
);

export const CarouselContainer = styled.div`

`;
